import React, { Component } from "react";
import {
  InputGroup,
  InputGroupAddon,
  InputGroupText,
  Input
} from "react-bootstrap";
import { Form, Button, Col, Card } from "react-bootstrap";

class RetriveRecords extends Component {
  render() {
    return (
      <div className="form">
        <Card style={{ width: "48rem" }}>
          <Card.Body>
            <Card.Title>RetriveRecords</Card.Title>
            <InputGroup>
              <InputGroup.Prepend>
                <InputGroup.Text>With textarea</InputGroup.Text>
              </InputGroup.Prepend>
              {/* <Form. as="textarea" aria-label="With textarea" /> */}
            </InputGroup>
          </Card.Body>
        </Card>
      </div>
    );
  }
}
export default RetriveRecords;
